import React from 'react';
import {Tooltip, Icon} from 'antd';

function LikeDislikes(props) {
    return (
        <div>
            {/* 좋아요 */}
            <span key="comment-basic-like">
                <Tooltip title="Like">
                    <Icon 
                        type="like"
                        theme="filled"
                        onClick
                    />
                </Tooltip>
                <span style={{paddingLeft:'8px', cursor:'auto'}}> 1 </span>
            </span>

            {/* 싫어요 */}
            <span key="comment-basic-like">
                <Tooltip title="Disike">
                    <Icon 
                        type="dislike"
                        theme="outlined"
                        onClick
                    />
                </Tooltip>
                <span style={{paddingLeft:'8px', cursor:'auto'}}> 1 </span>
            </span>
        </div>
    );
}

export default LikeDislikes;
